import React from 'react';
import InputField from '../components/InputField';

const InvoiceFilter = (props) => {

    const handleChange = (e) => {
        props.handleChange(e);
    };

    const handleSubmit = (e) => {
        props.handleSubmit(e);
    };

    return (
        <form onSubmit={handleSubmit}>
            <div className="row">
            <div className="col">
                <InputSelect
                    name="directorID"
                    items={props.personList}
                    handleChange={handleChange}
                    label="Odberatel"
                    prompt="nevybrán"
                    value={filter.buyer._id}
                />
            </div>
            <div className="col">
                <InputSelect
                    name="directorID"
                    items={props.personList}
                    handleChange={handleChange}
                    label="Odberatel"
                    prompt="nevybrán"
                    value={filter.seller._id}
                    />
                    <InputField
                    type="string"
                    min="0"
                    name="Product"
                    handleChange={handleChange}
                    label="Produkt"
                    prompt="neuveden"
                    value={filter.product}
                />
                <InputField
                    type="number"
                    min="0"
                    name="MinPrice"
                    handleChange={handleChange}
                    label="Cena od"
                    prompt="neuveden"
                    value={filter.minPrice ? filter.minPrice : ''}
                />
                <InputField
                    type="number"
                    min="0"
                    name="MaxPrice"
                    handleChange={handleChange}
                    label="Cena do"
                    prompt="neuveden"
                    value={filter.maxPrice ? filter.maxPrice : ''}
                />
                 <InputField
                    type="number"
                    min="1"
                    name="limit"
                    handleChange={handleChange}
                    label="Limit počtu faktur"
                    prompt="neuveden"
                    value={filter.limit ? filter.limit : ''}
                />
            </div>
            <InputField
                type="number"
                min="1"
                name={props.name}
                handleChange={handleChange}
                label={props.label}
                prompt="neuveden"
                value={props.value}
            />

            <input
                type="submit"
                className="btn btn-secondary float-right mt-2"
                value={props.confirm}
            />
            </div>
        </form>
    );
};

export default InvoiceFilter;
